const MealItem = (props) => {

  return (
    <li className={classes.item} key={props.id}>
      <div>
        <h3 className={classes.name}>{props.name}</h3>
        <p>{props.description}</p>
        <p>{props.price}</p>
      </div>
      <div>
        <p>amount</p>
        <button>Add</button>
      </div>
    </li>
  );
};
export default MealItem;
